using namespace std;
typedef long long ll;
vector<pair<ll,ll>> adj[100005];
ll dp[100005];
ll ans[100005];
ll dfs(int n,int par)
{
    if(dp[n]!=-1) return dp[n];
    ll ans=0;
    for(auto ch:adj[n])
    {
        if(ch.first != par)
        {
            ans=max(ans,dfs(ch.first,n)+ch.second);
        }
    }
    return dp[n]=ans;
}
void rrdp(int n,int par,int edwt)
{
    ll a=0,b=0;
    for(auto ch:adj[n])
    {
        if(ch.first != par)
        {
            ll val = dp[ch.first]+ch.second;
            if(val>b) a=b,b=val;
            else if(val>a) a=val;
        }
    }
    if(par!=-1)
    {
        ll val = dp[par]+edwt;
        if(val>b) a=b,b=val;
        else if(val>a) a=val;
    }
    ans[n]=b;
    for(auto ch:adj[n])
    {
        if(ch.first != par)
        {
            if(dp[ch.first]+ch.second == b) dp[n]=a;
            else dp[n]=b;
            rrdp(ch.first,n,ch.second);
        }
    }
    dp[n]=b;
}
void solve()
{
    int n;cin>>n;
    for(int i=1;i<=n;i++) adj[i].clear(),dp[i]=-1,ans[i]=0;
    for(int i=0;i<n-1;i++)
    {
        int u,v,d;cin>>u>>v>>d;
        adj[u].push_back({v,d});
        adj[v].push_back({u,d});
    }
    dfs(1,-1);
    rrdp(1,-1,0);
    for(int i=1;i<=n;i++) cout<<ans[i]<<" ";
}
